import React from 'react'

function Contact() {
    return (
        <div>
            <form>
              Adiniz:<input type="text" placeholder="Jon"/><br></br>
              Soyadiniz:<input type="text" placeholder="Doe"/>
            </form>
        </div>
    )
}

export default Contact
